import { MultiSelect } from "react-multi-select-component";
import { useState } from "react";

const options = [
    { label: "AG-NWS", value: "AG-NWS" },
    { label: "Altdorf", value: "Altdorf" },    
    { label: "Bern", value: "Bern" },
    { label: "Bulle", value: "Bulle" },
    { label: "FR-NE-JU-Taf", value: "FR-NE-JU-Taf" },
    { label: "GR-OCH", value: "GR-OCH" },
    { label: "Lausanne", value: "Lausanne" },
    { label: "Genf", value: "Genf" },
    { label: "Luzern", value: "Luzern" },
    { label: "Olten", value: "Olten" },
    { label: "PBK Chur", value: "PBK Chur" },
    { label: "Rapperswil", value: "Rapperswil" },
    { label: "Schwyz", value: "Schwyz" },
    { label: "Solothurn", value: "Solothurn" },
    { label: "Stans", value: "Stans" },
    { label: "Uri", value: "Uri" },
    { label: "Visp", value: "Visp" },
    { label: "Zurich", value: "Zurich" },
  ];
  
  const Drive = (props) => {
    const [selectedDrive, setSelectedDrive] = useState([]);
  
    return (
      <div>
        <MultiSelect
          options={options}
          value={selectedDrive}
          onChange={setSelectedDrive}
        />
      </div>      
    );
  };
  
export default Drive;
